import React from 'react';
import {Button,Icon} from 'semantic-ui-react'

const AddButton = (props)=>{

    return(
        <Button style={{position:'absolute',zIndex:"999", backgroundColor:"transparent",bottom:'0px',right:'0px'}} circular icon>
                <Icon style={{position:'relative',right:'-32px',bottom:'-32px'}} corner='bottom left' size='large' circular name={props.sign} inverted color='orange'/>
        </Button> 
    )
}



export default AddButton;
